import LoginForm from "../components/auth/LoginForm";
import RegisForm from "../components/auth/RegisForm";
import SlideForm from "../components/auth/SlideForm";
import styles from "./Auth.module.css";
import Logo from '../assets/logo.png';
    import axios from 'axios';

const Auth = () => {

const loginUser = async userForm => {
    try {
        const res = await axios.post('https://localhost:5000/api/auth/login')
        console.log(res);
        return res;
    } catch(err) {
        console.log(err);
    }
}

    const login = async e=>{
        e.preventDefault();
        const loginData = await loginUser({
            username:'minh123',
            password: '123456'
        });
        console.log(loginData);
    }

    return (
        <>
        <div className={styles.body}>
            <div className={styles.wrapper}>
                <div className={styles.container}>
                    <SlideForm  />
                    <div className={styles.login_form_side}>
                        <div className={styles.logo_wrapper}>
                            <img className={styles.logo} alt="logo" src={Logo}/>
                        </div>
                        <LoginForm onSubmit={login} />
                    </div>
                    <div className={styles.regis_form_side}>
                        <RegisForm/>
                    </div>
                </div>
            </div>
        </div>
        </>
    );
}

export default Auth;
